  .get(lopHocController.getAll)
  .post(lopHocController.add);
router
  .route("/:id")
  .post(lopHocController.update)
  .get(lopHocController.Delete);

  router
  .route("/hocvien/:id")
  .get(lopHocController.getAllhocvien)
module.exports = router;

